require './lib/beefcake.rb'

class MyMessage
  include Beefcake::Message
  required :number, :int32,  1
  required :chars,  :string, 2
  required :raw,    :bytes,  3
  required :bool,   :bool,   4
  required :float,  :float,  5
end



class MNItemCountBuffer
  include Beefcake::Message

  required :item, :string, 1
  required :count, :int32, 2
end

class MNSkillBuffer
  include Beefcake::Message

  required :name, :string, 1
  optional :gem, :string, 2
end

class MNLevelBuffer
  include Beefcake::Message
  optional :status, :int32, 1
  optional :specialCandyFed, :int32, 2
end

class MNMonsterBuffer
  include Beefcake::Message

  required :uid, :int64, 1
  required :raceName, :string, 2
  required :name, :string, 3
  required :level, :int32, 4
  required :health, :int32, 12
  required :nextCareTime, :int64, 5
  required :lastTickTime, :int64, 10
  required :deadUntil, :int64, 13
  required :happiness, :float, 11
  repeated :activeSkills, :string, 6
  required :xp, :int32, 7
  repeated :skills, MNSkillBuffer, 8
  optional :collar, :string, 9
  
  # 1.1 additions
  repeated :personality, :float, 15
  repeated :thoughts, :float, 16
  
  optional :favoriteRace, :string, 17
  optional :leastFavoriteRace, :string, 18
  
  optional :loveMeter, :int32, 19
  optional :foodMeter, :int32, 20
  optional :sleepMeter, :int32, 21
  
  optional :favoriteFood, :string, 22
  optional :leastFavoriteFood, :string, 23
  optional :favoriteFoodDiscovered, :bool, 24
  
  optional :isSleeping, :bool, 25
  repeated :perks, :string, 26
  
  optional :elatedUntil, :int64, 27
  optional :wildUntil, :int64, 28
  
  optional :captureDate, :int64, 29
  optional :largestHit, :int32, 30
  optional :killingBlows, :int32, 31
  optional :lifetimeFoodEaten, :int32, 32
  optional :lifetimeHappiness, :int32, 33
  optional :battlesFought, :int32, 34
  
  optional :candyFedToday, :int32, 35
  
  optional :elementalBoosts, :int32, 36
  optional :attackBoosts, :int32, 37
  optional :defenseBoosts, :int32, 38
  optional :archetype, :int32, 39
  optional :attackFuzz, :float, 40
  optional :elementalFuzz, :float, 41
  optional :defenseFuzz, :float, 42
  optional :captureLevel, :int32, 43;
  repeated :levelHistory, MNLevelBuffer, 44
  
  optional :raceUID, :int32, 45
end

class MNPlayerBuffer
  include Beefcake::Message

  required :uid, :int64, 1
  required :revision, :int64, 2
  repeated :party, MNMonsterBuffer, 3
  repeated :monsters, MNMonsterBuffer, 4
  repeated :inventory, MNItemCountBuffer, 5
  required :currentIsland, :string, 6
  required :ftueState, :int32, 7
  optional :fbid, :int64, 8
  optional :fbAccessToken, :string, 9
  optional :fbExpirationDate, :int32, 10
  required :season, :int32, 11
  required :stars, :int32, 12
  required :progress, :int64, 13
  repeated :goalsCompleted, :string, 14
  required :credits, :int32, 15
  optional :deviceToken, :bytes, 16
  optional :locksBroken, :int32, 21
  optional :payForPlaceKeys, :int64, 22
  optional :name, :string, 23
end

